console.log("Krunker Font Changer: Loaded")

// Other website fonts may not load because of cross-origin policy. To avoid this, this script uses Base64 encoded font.
// You can use some tools like https://www.giftofspeed.com/base64-encoder/ to encode the font.
let fontTypeGame = "ttf", // Game font's MIME type
	fontTypeHeader = "" // Header font's MIME type, just put "fontTypeGame" if you want to use same font

// Paste Base64 encoded game font data here. Default font is "Titillium Web"
let fontBase64Game = "",
	fontBase64Header = "" // Just put "fontBase64Game" if you want to use same font

let targetCSS = [...document.styleSheets].find(styleSheet => new RegExp(`^${location.origin}\/css\/(editor|main|social).css`).test(styleSheet.href))
if (targetCSS) {
    let cssFontFaceRules = [...targetCSS.cssRules].filter(cssRule => cssRule.type == 5)
    cssFontFaceRules.forEach(cssFontFaceRule => cssFontFaceRule.style.src = cssFontFaceRule.style.src.replace("./fonts/font2.ttf", fontTypeGame && fontBase64Game ? `data:font/${fontTypeGame};base64,${fontBase64Game}` : "./fonts/font2.ttf").replace("./fonts/header.ttf", fontTypeHeader && fontBas64Header ? `data:font/${fontTypeHeader};base64,${fontBase64Header}`: "./fonts/header.ttf"))

    // Patch few elements for custom fonts
    let patchCSS = document.createElement("style")
    patchCSS.innerText = `.purchBtn, .purchInfoBtn {
		position: absolute;
		bottom: 11px;
	}
	.scrollItem > div {
		overflow: auto;
	}`
document.head.appendChild(patchCSS)
    console.log("Krunker Font Changer: Replaced - Targets:", cssFontFaceRules)
} else {
    console.log("Krunker Font Changer: Skipped - Couldn't find any target CSS file")
}
//ESP
(function() {
    'use strict';
    let initialize = function(data) {
        let regex = /if\(!\w+\['(\w+)']\)continue/; //Hook
        let result = regex.exec(data);
        if (result) {
            const inView = result[1];
            const push = Array.prototype.push;
            Array.prototype.push = function(...args) {
                push.apply(this, args);
                if (args[0] instanceof Object && args[0].isPlayer) { //isPlayer is the value. If this get patched change isPlayer to new value to make it work
                    Object.defineProperty(args[0], inView, {value: true, configurable: false});
                }
            }
        }
    }
    //Hook Control
    const decode = window.TextDecoder.prototype.decode;
    window.TextDecoder.prototype.decode = function(...args) {
        let data = decode.apply(this, args);
        if (data.length > 1050000) {
            initialize(data);
        }
        return data;
    }
})();
